import "./styles.css";
import Header from "./Components/Header";
import Footer from "./Components/Footer";
import MovieGrid from "./Components/MoviesGrid";
import { SearchBar } from "./Components/SearchBar";

function App() {
  return (
    <div className="App">
      <div className="container">
        <Header />
      </div>
      <SearchBar></SearchBar>
      <MovieGrid />
      <Footer />
    </div>
  );
}

export default App;
